import React, { useState } from 'react';

function App() {
  const [messages, setMessages] = useState([
    {
      role: 'system',
      content: `You are an MQL4 coding expert. The user will describe a trading strategy in plain English, and your job is to output complete, clean MQL4 Expert Advisor (.mq4) code that matches the strategy.

Include:
- OnInit(), OnDeinit(), and OnTick()
- Risk management
- Comments in the code

If the user mentions an OrderSend error (like error 130), explain it's likely due to invalid stops (TP/SL too close or not normalized). Suggest debugging with Print() and using NormalizeDouble(..., Digits).

Only return clean, compile-ready MQ4 code. No markdown. No explanations.`
    }
  ]);

  const [userInput, setUserInput] = useState('');
  const [loading, setLoading] = useState(false);
  const [code, setCode] = useState('');
  const [error, setError] = useState('');

  const sendMessage = async (customInput = null) => {
    const input = customInput !== null ? customInput : userInput;
    if (!input.trim()) return;
    setLoading(true);
    setError('');

    const updatedMessages = [...messages, { role: 'user', content: input }];
    setMessages(updatedMessages);
    setUserInput('');

    try {
      const res = await fetch('http://localhost:4000/api/generate-ea', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ messages: updatedMessages })
      });

      const data = await res.json();

      if (data.error) {
        setError(data.error);
      } else {
        const assistantMsg = { role: 'assistant', content: data.eaCode };
        setMessages([...updatedMessages, assistantMsg]);
        setCode(data.eaCode);
      }
    } catch (err) {
      setError('Something went wrong.');
    } finally {
      setLoading(false);
    }
  };

  const resetSession = () => {
    setMessages([
      {
        role: 'system',
        content: `You are an MQL4 coding expert. The user will describe a trading strategy in plain English, and your job is to output complete, clean MQL4 Expert Advisor (.mq4) code that matches the strategy.

Include:
- OnInit(), OnDeinit(), and OnTick()
- Risk management
- Comments in the code

If the user mentions an OrderSend error (like error 130), explain it's likely due to invalid stops (TP/SL too close or not normalized). Suggest debugging with Print() and using NormalizeDouble(..., Digits).

Only return clean, compile-ready MQ4 code. No markdown. No explanations.`
      }
    ]);
    setUserInput('');
    setCode('');
    setError('');
  };

  const downloadCode = () => {
    if (!code) return;
    const blob = new Blob([code], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.download = 'MyExpertAdvisor.mq4';
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial', color: '#0f0', backgroundColor: '#000' }}>
      <h2>🧠 MQL4 Expert Advisor Builder</h2>

      <textarea
        rows={5}
        style={{ width: '100%', padding: '10px', fontFamily: 'monospace', marginBottom: '10px' }}
        value={userInput}
        onChange={(e) => setUserInput(e.target.value)}
        placeholder="Describe your EA logic here..."
      />

      <div>
        <button onClick={() => sendMessage()} disabled={loading}>Generate</button>
        <button onClick={resetSession} style={{ marginLeft: 10 }}>Reset</button>
        <button onClick={downloadCode} style={{ marginLeft: 10 }} disabled={!code}>Download MQ4</button>
      </div>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {code && (
        <pre style={{ marginTop: 20, background: '#111', padding: '15px', whiteSpace: 'pre-wrap' }}>{code}</pre>
      )}

      <div style={{ marginTop: 60 }}>
        <h3>🧰 Common EA Problems & Fixes</h3>

        <details>
          <summary>❌ OrderSend Error 130 (Invalid Stops)</summary>
          <ul>
            <li>Check if your TP/SL are too close to price.</li>
            <li>Use <code>NormalizeDouble()</code> to match your broker’s digits.</li>
            <li>Debug with:
              <pre style={{ background: '#222', color: '#0f0', padding: '8px' }}>
Print("Ask=", Ask, "  TP=", tp, "  SL=", sl);
              </pre>
            </li>
          </ul>
        </details>

        <details>
          <summary>❌ EA won’t open a trade?</summary>
          <ul>
            <li>Check <code>GetLastError()</code> after OrderSend.</li>
            <li>Ensure trading is enabled in the MetaTrader terminal.</li>
            <li>Print return values and debug.</li>
          </ul>
        </details>

        <details>
          <summary>🧠 What is NormalizeDouble()?</summary>
          <ul>
            <li>Ensures your price levels use the correct number of decimals.</li>
            <li>Example:
              <pre style={{ background: '#222', color: '#0f0', padding: '8px' }}>
NormalizeDouble(price + TakeProfit * Point, Digits)
              </pre>
            </li>
          </ul>
        </details>
      </div>

      <div style={{ marginTop: 40 }}>
        <h3>🧪 Quick Start Examples</h3>
        <button
          onClick={() => sendMessage('Create an EA that buys when RSI is below 30 and MACD turns green. TP 30, SL 20.')}
          style={{ marginRight: 10 }}
        >
          RSI + MACD EA
        </button>
        <button
          onClick={() => sendMessage('Build an EA that opens a sell when a bearish engulfing candle forms on H1.')}
        >
          Candle Pattern EA
        </button>
      </div>
    </div>
  );
}

export default App;
